import { useEffect, useState } from "react";

const Home = () => {
    const [workouts, setWorkouts] = useState(null)

    useEffect(() => {
        const fetchWorkouts = async() => {
            const response = await fetch('/api/workouts')
            const json = await response.json()

            if(response.ok){
                setWorkouts(json)
            }
        }
    }, [])


    return (
        <div className="home">
            <h1> HOME </h1>
        </div>
    )
}

export default Home;
